{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/jarredpriester/predicting-a-building-s-energy-efficiency?scriptVersionId=92409375\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"270f47dc","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.251464,"end_time":"2022-04-08T01:52:55.735914","exception":false,"start_time":"2022-04-08T01:52:55.48445","status":"completed"},"tags":[]},"source":["# Predicting a Building's Energy Efficiency\n","## Jarred Priester\n","### 2/5/2022"]},{"cell_type":"markdown","id":"f3be0b19","metadata":{"papermill":{"duration":0.25045,"end_time":"2022-04-08T01:52:56.235107","exception":false,"start_time":"2022-04-08T01:52:55.984657","status":"completed"},"tags":[]},"source":["1. Introduction\n","  + 1.1 Overview of the problem\n","  + 1.2 description of the dataset\n","  + 1.3 goal of the project\n","  + 1.4 plan of action\n","\n","2. Data Cleaning\n","  + 2.1 downloading the data\n","  + 2.2 cleaning NAs\n","  + 2.3 cleaning black observations\n","  + 2.4 scaling the data set\n","  \n","3. Data Visualization\n","\n","4. Models\n","  + 4.1 train and test sets\n","  + 4.2 linear regression\n","  + 4.3 ridge regression\n","  + 4.4 random forest\n","  + 4.5 ensemble \n","  \n","5. Results\n","  + 5.1 table of results\n","  + 5.2 plot of results\n","  + 5.3 brief thoughts on results\n","\n","6. Conclusion\n","  + 6.1 summary\n","  + 6.2 limitations\n","  + 6.3 next steps"]},{"cell_type":"markdown","id":"7856953b","metadata":{"papermill":{"duration":0.250204,"end_time":"2022-04-08T01:52:56.735516","exception":false,"start_time":"2022-04-08T01:52:56.485312","status":"completed"},"tags":[]},"source":["# 1. Introduction\n","\n","## 1.1 overview of the problem\n","\n","With record high and low temperatures across the globe, it is becoming increasing important to be efficient when it comes to heating and cooling our buildings. Whether you are trying to reduce the cost of your energy bill or you're trying to reduce your carbon footprint, improving the energy efficacy of your building can both save you some money and even help the environment. We will be looking at a data set that can help us with both! \n","\n","## 1.2 description of the data set\n","\n","This data set we will be using is from the University of California, Irvine Machine Learning Repository.\n","\n","The following is UCI's information on the data set:\n","\n","*Source:*\n","\n","*The dataset was created by Angeliki Xifara (Civil/Structural Engineer) and was processed by Athanasios Tsanas (Oxford Centre for Industrial and Applied Mathematics, University of Oxford, UK).*\n","\n","\n","*Data Set Information:*\n","\n","*We perform energy analysis using 12 different building shapes simulated in Ecotect. The buildings differ with respect to the glazing area, the glazing area distribution, and the orientation, amongst other parameters. We simulate various settings as functions of the afore-mentioned characteristics to obtain 768 building shapes. The dataset comprises 768 samples and 8 features, aiming to predict two real valued responses. It can also be used as a multi-class classification problem if the response is rounded to the nearest integer.*\n","\n","\n","*Attribute Information:*\n","\n","*The dataset contains eight attributes (or features, denoted by X1...X8) and two responses (or outcomes, denoted by y1 and y2). The aim is to use the eight features to predict each of the two responses.*\n","\n","*Specifically:*\n","\n","*X1 Relative Compactness*\n","\n","*X2 Surface Area*\n","\n","*X3 Wall Area*\n","\n","*X4 Roof Area*\n","\n","*X5 Overall Height*\n","\n","*X6 Orientation*\n","\n","*X7 Glazing Area*\n","\n","*X8 Glazing Area Distribution*\n","\n","*y1 Heating Load*\n","\n","*y2 Cooling Load*\n","\n","https://archive.ics.uci.edu/ml/datasets/Energy+efficiency\n","\n","## 1.3 goal of the project\n","\n","The goal of this project is to create multiple regression models that come up with predictions for both the heating and cooling load. We will take the best performing model.\n","\n","## 1.4 plan of action\n","\n","We will download and cleaning the data. We will use visualization tools to get a better understanding of the data that we are working with. THen we will be create the following regression models: *linear regression*, *ridge regression*, *random forest*, *ensemble*. The models will be  evaluated by using the Root Mean Squared Error (RMSE)\n","\n","RMSE = $$\\sqrt{\\frac{1}{n}\\sum_{u,i}=(\\hat{y}_{u,i}-y_{u,i})^2}$$\n","\n","Finally, we will create a results table of the models and evaluate the results"]},{"cell_type":"markdown","id":"7ff52be2","metadata":{"papermill":{"duration":0.252814,"end_time":"2022-04-08T01:52:57.236245","exception":false,"start_time":"2022-04-08T01:52:56.983431","status":"completed"},"tags":[]},"source":["# 2. Data Cleaning\n","\n","## 2.1 downloading the data"]},{"cell_type":"code","execution_count":1,"id":"becec286","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-04-08T01:52:57.742329Z","iopub.status.busy":"2022-04-08T01:52:57.738895Z","iopub.status.idle":"2022-04-08T01:53:01.365841Z","shell.execute_reply":"2022-04-08T01:53:01.364388Z"},"papermill":{"duration":3.879809,"end_time":"2022-04-08T01:53:01.366072","exception":false,"start_time":"2022-04-08T01:52:57.486263","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u