 = \"Rounding\")\n","\n","#splitting data into test and train data sets\n","test_index <- createDataPartition(energy$Heating_Load, times = 1, p = 0.2, list = FALSE)\n","test <- energy[test_index,]\n","train <- energy[-test_index,]"]},{"cell_type":"markdown","id":"0211f76c","metadata":{"papermill":{"duration":0.31072,"end_time":"2022-04-08T01:53:26.049161","exception":false,"start_time":"2022-04-08T01:53:25.738441","status":"completed"},"tags":[]},"source":["checking to see if the test and train have similar outcomes"]},{"cell_type":"code","execution_count":20,"id":"f378265a","metadata":{"execution":{"iopub.execute_input":"2022-04-08T01:53:26.685043Z","iopub.status.busy":"2022-04-08T01:53:26.682021Z","iopub.status.idle":"2022-04-08T01:53:26.712726Z","shell.execute_reply":"2022-04-08T01:53:26.710423Z"},"papermill":{"duration":0.350438,"end_time":"2022-04-08T01:53:26.712981","exception":false,"start_time":"2022-04-08T01:53:26.362543","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["22.2798202614379"],"text/latex":["22.2798202614379"],"text/markdown":["22.2798202614379"],"text/plain":["[1] 22.3"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["22.4146153846154"],"text/latex":["22.4146153846154"],"text/markdown":["22.4146153846154"],"text/plain":["[1] 22.4"]},"metadata":{},"output_type":"display_data"}],"source":["mean(train$Heating_Load)\n","mean(test$Heating_Load)"]},{"cell_type":"markdown","id":"ce6811c5","metadata":{"papermill":{"duration":0.321526,"end_time":"2022-04-08T01:53:27.372548","exception":false,"start_time":"2022-04-08T01:53:27.051022","status":"completed"},"tags":[]},"source":["Will be using k-fold cross validation on all the algorithms"]},{"cell_type":"code","execution_count":21,"id":"94c0595e","metadata":{"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-04-08T01:53:28.013592Z","iopub.status.busy":"2022-04-08T01:53:28.011345Z","iopub.status.idle":"2022-04-08T01:53:28.039394Z","shell.execute_reply":"202